import React from 'react';
import { Field, reduxForm } from 'redux-form';


class ProjectForm extends React.Component{


    renderTextInput=(data)=>{
        console.log(data);
        return (
            <div className="field">
            <label>Qoute Number :</label>

            <div class="ui labeled input">
              <div class="ui label">Q-</div>
              <input
                type="text"
                value={this.props.qouteNumber}
                onChange={(e) => {
                  this.setState({ qouteNumber: e.target.value });
                }}
              />
            </div>
            </div>
        );
    }

    render(){

        return(

            <form className="ui form">
                
                <Field 
                    component={this.renderTextInput}
                    name="qouteNumber"
                    label="Qoute Number"
                />
            </form>
        );
    }
}


export default reduxForm({
    form: 'projectForm'
})(ProjectForm);
